import Vuex from 'vuex'

const PageOne = {
    state: {
        teste: 'Aqui a page1'
    }
}

const PageTwo = {
    state: {
        teste: 'Aqui a page2'
    }
}

export default new Vuex.Store({
    modules: {
        PageOne,
        PageTwo
    }
})
